//       navigate('/');
//     }
//   }, [name, username, navigate]);

//   // Store the name in local storage whenever it changes
//   React.useEffect(() => {
//     localStorage.setItem('name', name);
//   }, [name]);
// }

function useHandleVisitor(username) {
  const navigate = useNavigate();
  const storedName = localStorage.getItem('name');

  React.useEffect(() => {
    if (storedName !== username || storedName == null) {
      navigate('/');
    }
  }, [storedName, username, navigate]);

  // Store the name in local storage whenever it changes
  React.useEffect(() => {
    localStorage.setItem('name', username);
  }, [username]);
}


